    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) AS cor0 WHERE 47 * col1 * + 75 + - col1 IS NOT NULL;
  - name: tab2

outputs:
  - name: q10016.out
    data: |
      46	51	23
      64	77	40
      75	67	58
